(function ($) {
  var toggleChildAccordian = function($div) {
    var $div = $div.parents('div.accordian-trigger');
    var openDivId = $div.find('a').data('show-content');
    var $content = $('#' + openDivId);

    // Close other open divs
    var otherOpenDivs;
    if ($div.parents('div.accordian-child').length > 0) {
      console.log('nested accordian?');
      otherOpenDivs = $div.parents('div.accordian-child').find('div.open');
    } else {
      otherOpenDivs = $('div.accordian-content').find('div.accordian-top-content').find('div.open');
    }

    if ($div.hasClass('closed')) {
      console.log('should open');
      $div.addClass('open').removeClass('closed');
      $content.addClass('open').removeClass('closed');

        if ($('.accordian-trigger').parent().hasClass('related-question-accordian')) {
          $('.accordian-trigger.open a h4').text('Close');
        }

      if ($div.parents('div.accordian-child').length > 0) {
        var parentId = $div.parents('div.accordian-child').attr('id');
        $('a[data-show-content="'+parentId+'"]').parents('div.accordian-trigger').addClass('child-opened');
      }

      if ($div.parents('div.accordian-top-content').length > 0) {
        console.log('Has top parent')
        var parentId = $div.parents('div.accordian-top-content').attr('id');
        //$('a[data-show-content="'+parentId+'"]').parents('div.accordian-trigger').addClass('child-opened');
        var $topTriggers = $('div.accordian-trigger.accordian-top');
        console.log($topTriggers);

        $.each($topTriggers, function(key,val) {
          if ($($topTriggers[key]).find('a[data-show-content="'+parentId+'"]').length > 0) {
            $($topTriggers[key]).addClass('child-opened');
          } else {
            $($topTriggers[key]).removeClass('child-opened');
          }
        });
      }

      if (otherOpenDivs.length > 0) {
        $.each(otherOpenDivs, function(key, val) {
          $(otherOpenDivs[key]).removeClass('open').addClass('closed').removeClass('child-opened');
        });
      }
    } else {
      if ($div.parents('div.accordian-child').length > 0) {
        var parentId = $div.parents('div.accordian-child').attr('id');
        $('a[data-show-content="'+parentId+'"]').parents('div.accordian-trigger').removeClass('child-opened');
      }

      if ( $div.parents('div.accordian-top-content').length > 0) {
        var parentId = $div.parents('div.accordian-top-content').attr('id');
        $('a[data-show-content="'+parentId+'"]').parents('div.accordian-trigger').removeClass('child-opened');
      }

      if (otherOpenDivs.length > 0) {
        $.each(otherOpenDivs, function(key, val) {
          $(otherOpenDivs[key]).removeClass('open').addClass('closed').removeClass('child-opened');
        });
      }

      console.log('should close');
      $div.removeClass('open').addClass('closed');
      $content.addClass('closed').removeClass('open');

      if ($('.accordian-trigger').parent().hasClass('related-question-accordian')) {
        $('.accordian-trigger.closed a h4').text('View More Questions Like This');
      }
    }

    if ($('.accordian-trigger').parent().hasClass('related-question-accordian')) {
      return;
    } else {
      console.log('scrolltop: ');
      console.log($div.offset().top  - $('section.header-wrapper').height());
      $('html, body').animate({
        scrollTop: $div.offset().top - $('section.header-wrapper').height()
      }, 500);
    }
  };

  var hideOtherTopAccordians = function($div) {
  };

  var hideOtherChildAccordians = function($div) {
  };

  var toggleTopAccordian = function($div) {
    var $wrapper = $div.parents('div.accordian-trigger');
    var openDivId = $wrapper.find('a').data('show-content');
    var $content = $('#' + openDivId);
    var otherOpenDivs = $div.parents('div.accordian-content').find('div.open');
    var parentId = $wrapper.find('a').data('show-content');
    var $topTriggers = $('div.accordian-trigger.accordian-top');

    $.each($topTriggers, function(key,val) {
      if ($($topTriggers[key]).find('a[data-show-content="'+parentId+'"]').length > 0) {
        $($topTriggers[key]).addClass('child-opened');
      } else {
        $($topTriggers[key]).removeClass('child-opened');
      }
    });

    if ($wrapper.hasClass('closed')) {
      $wrapper.addClass('open').removeClass('closed');
      $content.addClass('open').removeClass('closed');
      $wrapper.addClass('child-opened');

      if (otherOpenDivs.length > 0) {
        $.each(otherOpenDivs, function(key, val) {
          $(otherOpenDivs[key]).removeClass('open').addClass('closed').removeClass('child-opened');
        });
      }
    } else {
      // Close other open divs
      var otherOpenDivs = $div.parents('div.accordian-content').find('div.open');
      if (otherOpenDivs.length > 0) {
        $.each(otherOpenDivs, function(key, val) {
          $(otherOpenDivs[key]).removeClass('open').addClass('closed').removeClass('child-opened');
        });
      }

      $wrapper.removeClass('open').addClass('closed');
      $content.addClass('closed').removeClass('open');
      $wrapper.removeClass('child-opened');
    }

    if ($('.accordian-trigger').parent().hasClass('related-question-accordian')) {
      return;
    } else {
      $('html, body').animate({
        scrollTop: $div.offset().top - $('section.header-wrapper').height()
      }, 500);
    }
  };

  var toggleAccordian = function(e) {
    var $div = $(e.target);
    var $wrapper = $div.parents('div.accordian-trigger');

    if ($wrapper.hasClass('accordian-top')) {
      if (leaveTopOpen) {
        return false;
      }
      toggleTopAccordian($div);
    } else if ($wrapper.hasClass('accordian-trigger')) {
      toggleChildAccordian($div);
    }
  };

  var leaveTopOpen = $('section.shelter-rescue-faq').length > 0;
  $('div.accordian-trigger').on('click', toggleAccordian);
}(jQuery));

