(function ($) {
    var $form = $('section.auth').find('form');

    if ($('section.auth').length > 0) {
        var showError = function($field, message) {
            var $wrapper = $field.parent('div.field').parent('div.inline-form-field');
            if (typeof message !== 'undefined') {
                $wrapper.find('span.error').html(message);
                if (message.length > 27) {
                    $wrapper.find('span.error').addClass('long');
                } else {
                    $wrapper.find('span.error').removeClass('long');
                }
            } else {
                $wrapper.find('span.error').html('');
                $wrapper.find('span.error').removeClass('long');
            }
            $wrapper.addClass('error');
        }

        var hideError = function($field) {
            var $wrapper = $field.parent('div.field').parent('div.inline-form-field');
            $wrapper.removeClass('error');
            $wrapper.find('span.error').html('');
        }

        var focusField = function() {
            $(this).find('input,select').focus();
        }

        function validateEmail(email) {
            var re = /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
            return re.test(email);
        }
        var fieldActive = function() {
            var $field = $(this);
            $field.parent('div.field').parent('div.inline-form-field').addClass('active');
            if ($field.is('SELECT')) {
                changeSelectStyle($field);
            }
        }

        var showLabel = function($field) {
            if ($field.val() !== '') {
                $field.parent('div.field').find('label').addClass('show');
                $field.addClass('show');
            } else {
                hideLabel($field);
            }

        }

        var triggerShowLabel = function(e) {
            var $field = $(e.target);
            showLabel($field);
        }

        var triggerHideLabel = function(e) {
            var $field = $(e.target);
            hideLabel($field);
        }

        var hideLabel = function($field) {
            if ($field.val() == '' || typeof $field.val() === 'undefined') {
                $field.parent('div.field').find('label').removeClass('show');
                $field.removeClass('show');
            }
            $field.parent('div.field').parent('div.inline-form-field').removeClass('active');
        }

        var validateEmailField = function($field) {
            var fieldName = $field.attr('name');
            var fieldValue = $field.val();

            var $email = $form.find('input[name="email"]');
            if (fieldName === 'email' && fieldValue.length === 0 ) {
                showError($field, 'Required');
            } else if (fieldName === 'email' && !validateEmail(fieldValue)) {
                showError($field, 'Invalid Email');
            } else if (fieldName === 'email' ) {
                hideError($field);
            }
        }

        var validatePasswordField = function($field) {
            var fieldName = $field.attr('name');
            var fieldValue = $field.val();
            var $password = $form.find('input[name="password"]');
            var charactersRegex = /^[a-zA-Z0-9\!\$\%\#\@\~\&\*\(\)\_\-\+\=]{8,}$/;
            var capitalRegex = /[A-Z]/;
            var numberRegex = /[0-9]/;
            //var $confirm = $form.find('input[name="password_confirmation"]');
            if ( fieldName === 'password' && fieldValue.length === 0 ) {
                showError($field, 'Required');
            } else if (fieldName === 'password') {
                if (fieldName === 'password') {
                    var regex = /^(?=.*[0-9])(?=.*[A-Z])(?=.*[a-z])[a-zA-Z0-9\!\$\%\#\@\~\&\*\(\)\_\-\+\=]{8,}$/; // Contains at least 8 characters, no more than 30, with at least 1 number and 1 capital letter
                    if (!regex.test(fieldValue) ) {
                        showError($field, 'Invalid Password');
                    } else {
                        hideError($field);
                    }
                } else {
                    hideError($field);
                }
            }
            if (charactersRegex.test(fieldValue)) {
                $('div.password-validation').find('div.characters').addClass('valid');
                $('div.password-validation').find('div.characters').removeClass('error');
            } else {
                $('div.password-validation').find('div.characters').addClass('error');
                $('div.password-validation').find('div.characters').removeClass('valid');
            }

            if (numberRegex.test(fieldValue)) {
                $('div.password-validation').find('div.number').addClass('valid');
                $('div.password-validation').find('div.number').removeClass('error');
            } else {
                $('div.password-validation').find('div.number').addClass('error');
                $('div.password-validation').find('div.number').removeClass('valid');
            }

            if (capitalRegex.test(fieldValue)) {
                $('div.password-validation').find('div.capital').addClass('valid');
                $('div.password-validation').find('div.capital').removeClass('error');
            } else {
                $('div.password-validation').find('div.capital').addClass('error');
                $('div.password-validation').find('div.capital').removeClass('valid');
            }
        }

        var triggerValidateField = function (e) {
            var $field = $(e.target);
            validateField($field);
        }

        var validateField = function($field) {
            var fieldName = $field.attr('name'),
                fieldValue = $field.val(),
                $wrapper = $field.parent('div.field').parent('div.inline-form-field');

            if (fieldName === 'email') {
                validateEmailField($field);
            } else if (fieldName === 'password') {
                validatePasswordField($field);
            } else if (fieldName === 'password_confirmation') {
                validatePasswordField($field);
            }

        }
        var validateForm = function() {
            var fields = $form.find('input');
            $.each(fields, function(key, value) {
                validateField($(fields[key]));
            });
        }

        var isFormPrefilled = function() {
            var email = $form.find('input[name="email"]');
            var password = $form.find('input[name="password"]');
            if (email.val() !== '') {
                validateField(email);
            }
            if (password.val() !== '') {
                validateField(password);
            }
        }
        var showOrHidePasswords = function(e) {
            var $this = $(this),
                $fields = $('input.password');

            if (typeof $fields !== 'undefined') {
                if ($fields.attr('type') === 'password') {
                    $fields.attr('type', 'text');
                } else if ($fields.attr('type') === 'text') {
                    $fields.attr('type', 'password');
                }
            }
        }

        $('svg.show-password').on('click', showOrHidePasswords);

        $form.find('div.inline-form-field').on('click', focusField);
        $form.find('input').on('focus', fieldActive);
        $form.find('input').on('keyup change input', triggerShowLabel);
        $form.find('input').on('keyup change', triggerHideLabel);
        $form.find('input').on('blur', triggerValidateField);
        $(window).on('load', isFormPrefilled);
    }

}(jQuery));

