        var errorMessageForField = function($field, $typeOfError) {
            var fieldName = $field.attr('name'),
                label = $('label[for="'+fieldName+'"]').html();
            var messageText = '';
            if ($typeOfError === 'required') {
                if ($field.is('SELECT')) {
                    messageText = 'Select ' + label;
                } else {
                    messageText = 'Enter ' + label;
                }
            } else {
                 if ($field.is('SELECT')) {
                    if (fieldName === 'state') {
                        messageText = 'State Not Selected';
                    } else if (fieldName === 'opt_in_sms') {
                        messageText = 'Select SMS Preferences';
                    } else {
                        messageText = 'Select ' + label;
                    }
                } else {
                    if (fieldName === 'city') {
                        messageText = 'City Not Found In Selected State';
                    } else {
                        messageText = 'Invalid ' + label;
                    }
                }               
            }
            $field.attr('data-error-message', messageText);
            return messageText;
        }

        var updateErrorList = function() {
            var errors = $form.find('div.inline-form-field.error, textarea.error, div.key-facts-field.error');
            // erase previous errors
            $('ul#error-list').find('li').remove();
            var shouldShow = false;

            if (typeof errors !== 'undefined' && errors.length > 0) {
                shouldShow = true;
                $.each(errors, function(k,v) {
                    var $wrapper = $(errors[k]);
                    var name = '';
                    var message = '';
                    if ($wrapper.hasClass('key-facts-field')) {
                        name = $wrapper.find('div.key-facts-group').data('key-fact');
                        message = $wrapper.find('div.key-facts-group').data('error-message');
                    } else {
                        var $field = $wrapper.find('input,select,textarea');
                        name = $field.attr('name');
                        message = $field.attr('data-error-message');

                    }
                    $('ul#error-list').append('<li class="single-error" data-error-field="'+name+'"">'+message+'</li>');
                });
            }

            if (shouldShow === true) {
                $('div.error-list-wrapper').removeClass('hidden');
            } else {
                $('div.error-list-wrapper').addClass('hidden');
            }
        }

        var validateKeyFactRadio = function($field, processingPrevious) {
            var $fieldGroup = $field.parents('div.key-facts-group');
            var $wrapper = $fieldGroup.parent('div.key-facts-field');
            if ($fieldGroup.data('required') === true && (typeof $fieldGroup.find('input.key-fact-radio:checked') === 'undefined' || $fieldGroup.find('input.key-fact-radio:checked').length === 0)) {
                $wrapper.addClass('error');
            } else {
                $wrapper.removeClass('error');
            }
            if (typeof processingPrevious !== 'undefined') {
                return true;
            }
            // validate previous required key fact fields when finished validating current, should show error on required field if skipped
            var $previousFields = $fieldGroup.parent('div.key-facts-field').prevAll('div.key-facts-field').find('div.key-facts-group[data-required="true"]');
            $.each($previousFields, function(key,val) {
                validateKeyFactRadio($($($previousFields[key]).find('input[type="radio"].key-fact-radio')[0]), true);
            });
        }

