(function ($) {
	$.fn.ownerDashSection = function() {
		var $elem = $(this),
			sectionId = $elem.attr('data-open-section'),
			$section  = $('#'+sectionId),
			$closeSection = $section.find('a.close-section');

		if (typeof $section == 'undefined' || $section.length == 0) {
			$section = $('div[data-target-section="' + sectionId + '"]');
		}

		var toggleSection = function(e) {
			e.preventDefault();
			console.log('section clicked: ' + sectionId);
            console.log(e.target);
            // Reset previously selected div
            $('section.owner-sidebar').find('div.single-section.selected').removeClass('selected');
            if (!$(e.target).hasClass('close-section')) {
                $elem.toggleClass('selected');
            }
			$('section.owner-main-panel').toggleClass('open');
			$('section.owner-sidebar').toggleClass('close');
			$('section.owner-title').toggleClass('close');
			$section.toggleClass('open');

            scrollToSection();

            $('div.back-to-overview').toggleClass('hide');

           	$elem.trigger(sectionId + ':toggled');
		}

        var scrollToSection = function() {
            $('html, body').animate({
                scrollTop: $section.offset().top - $('section.header-wrapper').outerHeight()
            }, 500);
        }

		var sectionCompleted = function() {
			$elem.addClass('complete');
		}

		var sectionIncomplete = function() {
			$elem.removeClass('complete');
		}

        var closeAndToggleSection = function(e) {
            $('section.owner-sidebar').find('div.single-section.selected').removeClass('selected');
            toggleSection(e);
        }

		$elem.find('a').on('click', toggleSection);
		$elem.on(sectionId + ':complete', sectionCompleted);
		$elem.on(sectionId + ':incomplete', sectionIncomplete);
		$closeSection.on('click', closeAndToggleSection);
	}

}(jQuery));

