(function ($) {
	$.fn.ownerInboxMessage = function() {
		console.log('init message');
		var $elem = $(this),
		    $message = $elem.children('div.message'),
		    $spamLink = $elem.find('div.spam-link').find('a'),
		    $replyTo = $elem.children('div.reply-button-wrapper').find('button.reply-button'),
		    $replyToForm = $elem.children('div.reply-to-form'),
		    $showReplies = $elem.children('div.see-more').find('a'),
		    $replies = $elem.children('div.replies'),
		    messageId = $elem.attr('data-message-id'),
		    petId = $('input[name="pet_id"]').val(),
		    token = $('input[name="_token"]').val();

		var $remodalInstance;

		var initReplyTo = function() {
			$replyTo.on('click', toggleReplyToForm);
			$replyToForm.find('textarea').characterCount();
		}

		var toggleReplyToForm = function(e) {
			e.preventDefault();
			$replyToForm.toggleClass('open');
			$replyTo.parent('div.reply-button-wrapper').toggleClass('hide');
			$message.toggleClass('open');
			$replyToForm.find('div.close-more').find('a').off('click');
			$replyToForm.find('div.close-more').find('a').on('click', toggleReplyToForm);
			$replyToForm.find('textarea').on('keyup', toggleReplyToPostButton);
			$replyToForm.find('button.post-message').off('click');
			$replyToForm.find('button.post-message').on('click', maybePostMessage);
            toggleReplies();
		}

        var toggleReplies = function() {
            $replies.find('a.delete-message').off();
            $replies.find('a.delete-message').on('click', deleteMessage);
			$showReplies.parent('div.see-more').toggleClass('hide');
			$replies.toggleClass('open');
        }

		var toggleReplyToPostButton = function() {
			if ($replyToForm.find('textarea').val().length > 0) {
				$replyToForm.find('button.post-message').removeClass('disabled');
			} else {
				$replyToForm.find('button.post-message').addClass('disabled');
			}
		}

		var initShowReplies = function() {
			$showReplies.on('click', toggleReplyToForm);
			$replyToForm.find('textarea').characterCount();
		}

		var maybePostMessage = function() {
			var url = '/pet/' + petId + '/message/' + messageId + '/reply';
			if ($replyToForm.find('button.post-message').hasClass('disabled')) {
				return false;
			}

			var data = {
				'pet_id': petId,
				'reply_to_id': messageId,
				'message': $replyToForm.find('textarea').val(),
				'_token': token
			}

			$.post(url, data, function(response) {
				console.log(response);
				if (typeof response !== 'undefined' && typeof response.status !== 'undefined' && response.status === 'success') {
					message = response.message;
					addMessageToReplies(message);

					// Reset the form after saving message
					$replyToForm.find('textarea').val('');
					$replyToForm.find('button.post-message').addClass('disabled');
					$elem.removeClass('unread');
					$replies.addClass('open');
				}
			});
		}

		var addMessageToReplies = function(message) {
			var html = '<div class="single-reply" data-reply-id="' + message.messageId + '">';
			html = html + '<div class="from-name">' + message.fromUser + '</div>';
			html = html + '<div class="delete-link"><a href="#" class="delete-message"><svg width="20" height="23" viewBox="0 0 20 23" xmlns="http://www.w3.org/2000/svg"><title>Artboard 2</title><g fill="#B3B3B3" stroke="#B3B3B3" stroke-width=".5"><path d="M13.986 22.476H5.5a3.096 3.096 0 0 1-3.09-3.09V9.905c0-.315.21-.524.523-.524.315 0 .524.21.524.524v9.48c0 1.153.943 2.044 2.043 2.044h8.486a2.045 2.045 0 0 0 2.043-2.043V9.905c0-.315.21-.524.523-.524.315 0 .524.21.524.524v9.48c0 1.677-1.414 3.091-3.09 3.091zM16.71 3.567h-3.981C12.467 2.1 11.209 1 9.69 1 8.171 1 6.914 2.1 6.652 3.567h-3.98A2.124 2.124 0 0 0 .523 5.714c0 1.205.943 2.096 2.147 2.096h14.09a2.124 2.124 0 0 0 2.149-2.148c0-1.205-.996-2.095-2.2-2.095zm-7.02-1.52c.943 0 1.729.63 1.939 1.52H7.7c.262-.89 1.048-1.52 1.99-1.52zm7.02 4.715H2.67c-.576 0-1.1-.472-1.1-1.1 0-.576.472-1.1 1.1-1.1h14.09c.577 0 1.1.471 1.1 1.1-.051.628-.523 1.1-1.151 1.1z"/><path d="M6.81 20.224c-.315 0-.524-.21-.524-.524v-8.748c0-.314.21-.523.524-.523.314 0 .523.21.523.523V19.7c0 .262-.262.524-.523.524zm6.285 0c-.314 0-.524-.21-.524-.524v-8.748c0-.314.21-.523.524-.523.315 0 .524.21.524.523V19.7c0 .262-.262.524-.524.524zm-3.143 0c-.314 0-.523-.21-.523-.524v-8.748c0-.314.21-.523.523-.523.315 0 .524.21.524.523V19.7c0 .262-.262.524-.524.524z"/></g></svg>Delete</a></div>';
			html = html + '<div class="date">' + message.messageDate + '</div>';
			html = html + '<div class="message">' + message.messageBody + '</div>';
			$replies.append(html);
			$('div.single-reply[data-reply-id="'+message.messageId+'"]').find('div.delete-link').find('a').on('click', deleteMessage);
		}

		var deleteMessage = function(e) {
			e.preventDefault();
			console.log('clicked delete?');
			var $replyElem = $(e.target).parents('div.single-reply'),
				replyId = $replyElem.attr('data-reply-id'),
				url = '/pet/' + petId + '/message/' + replyId + '/delete';

			var data = {
				'_token': token,
				'message_id': replyId
			};

			$.post(url, data, function(response) {
				console.log(response);
				if (typeof response !== 'undefined' && typeof response.status !== 'undefined' && response.status === 'success') {
                    $replyElem.remove();
				}
			});
		}

		var flagMessage = function(flagMessageId) {
			var flagId = messageId,
				$flagMessage = $('div.single-question[data-message-id="'+flagId+'"]'),
				url = '/pet/' + petId + '/message/' + flagId + '/flag';

			var data = {
				'pet_id': petId,
				'message_id': flagId,
				'_token': token
			};

			$.post(url, data, function(response) {
				console.log(response);
				if (typeof response !== 'undefined' && typeof response.status !== 'undefined' && response.status === 'success') {
					$flagMessage.remove();
				}
			});
		}

		var confirmSpamModal = function() {
			var flagMessageId = $('div.confirm-spam-modal').find('input[name="spam-message-id"]').val();
			flagMessage(flagMessageId);
			closeSpamModal();
		}

		var closeSpamModal = function(flagMessageId) {
			$remodalInstance.close();
		}

		var showSpamModal = function(e) {
			e.preventDefault();
			var $spamModal = $('div.confirm-spam-modal'),
				flagMessageId = $(this).parents('div.single-question').attr('data-message-id');

			$spamModal.find('input[name="spam-message-id"]').val(flagMessageId);
			$remodalInstance = $spamModal.remodal();
            $(document).off('confirmation');
            $(document).on('confirmation', '.confirm-spam-modal', function() {
            	console.log('confirmed');
                confirmSpamModal();
            });
            $(document).off('closed');
            $(document).on('closed', '.confirm-spam-modal', function (e) {
            	console.log('closed');
                if ( e.reason == undefined || e.reason == false || e.reason !== 'confirmation') {
                	$spamModal.find('input[name="spam-message-id"]').val('');
                }
            });
            $remodalInstance.open();
		}

		if ($replyTo.length > 0) {
			initReplyTo();
		}

		if ($showReplies.length > 0) {
			initShowReplies();
		}

		$spamLink.on('click', showSpamModal);
	}
}(jQuery));

