(function ($) {
	$.fn.ownerMyAccountSection = function() {
		var $elem = $(this),
			petId = $('input[name="pet_id"]').val();

		var previousStatus;

		var saveRehomeDeadlineAndReason = function() {
			var name = $(this).attr('name');
			// Don't try to save an empty deadline
			if (name === 'rehome_deadline' && $(this).val() == '') {
				return false;
			}
			// track events in Google Analytics
			if (name === 'rehome_deadline') {
				ga('gtm1.send', 'event', 'Rehome Republish', 'Changed time to keep pet', true);
			}

			if (name === 'rehome_reason') {
				ga('gtm1.send', 'event', 'Rehome Republish', 'Changed Reason for Rehoming', true);
			}

			var data = $elem.find('input,select,textarea').serialize();
			$.post('/mypets/save-deadline-reason/' + petId, data, function(response) {
				console.log(response);
				if (typeof response !== 'undefined' && typeof response.status !== 'undefined' && response.status === 'success') {
					updateRehomeByDate(response.data.rehomeByDate);
				}
			});
		}

		var updateRehomeByDate = function(rehomeByDate) {
			$elem.find('span.rehome_by_date').text(rehomeByDate);
		}

		var saveSmsOptIn = function() {
			if ($(this).val() == '') {
				return false;
			}
			var data = $elem.find('select[name="opt_in_sms"],input[name="_token"]').serialize();
			$.post('/mypets/save-sms-optin/' + petId, data, function(response){
				console.log(response);
			});
		}

		var changePetStatus = function() {
			var newStatus = $elem.find('select[name="status"]').val();

			if (typeof newStatus === 'undefined' || newStatus === '') {
				return false;
			}
            // pet status
            ga('gtm1.send', 'event', 'Rehome Republish', 'Changed Status');

			if (newStatus == 'available') {
				$(document).trigger('republish-pet-modal:open');
			} else {
				$(document).trigger('delete-pet-modal:open');
			}
		}

		var getPreviousStatus = function() {
			previousStatus = $(this).val();
		}

		var resetPetStatusField = function() {
			if (typeof previousStatus !== 'undefined') {
                $elem.find('select[name="status"]').val(previousStatus);
			}
		}


		$elem.find('select[name="rehome_deadline"],select[name="rehome_reason"]').on('change', saveRehomeDeadlineAndReason);
		$elem.find('select[name="opt_in_sms"]').on('change', saveSmsOptIn);
		$elem.find('select[name="status"]').on('change', changePetStatus);
		$elem.find('select[name="status"]').on('focus', getPreviousStatus);
		$(document).on('pet-status:reset', resetPetStatusField);
	};
}(jQuery));
