      if (targetElement.hasClass("hide-field")) {
        targetElement.removeClass("hide-field");
        hideElements([$typeOfOrg, $inlineText]);
        disableSubmit();
      }

      clearShelterOrRescue();
      adoptedByNone();

      $(".other-platform")[0].style.opacity = "1.0";
      $(".welfare-organization")[0].style.opacity = "0.4";
