(function ($) {
	var uploaderObjects = {};
	$.fn.aapPhotoUpload = function(options) {
		var opts = $.extend( {}, $.fn.aapPhotoUpload.defaults, options ),
			elem = $(this);

		var defaultDesktopText = 'Drag and Drop Files or Click Here to Upload';
		var defaultMobileText = 'Tap to Upload';
		var pendingDesktopText = 'Image Uploaded';
		var pendingMobileText = 'Image Uploaded';

		var uploader = new plupload.Uploader({
			browse_button: opts.browse_button, // Manually trigger add file dialog by clicking this element
			url: '/pet/' + opts.pet_id + '/add_photo/' + opts.photo_id + '_id',
			drop_element: opts.drop_element, // Use as dropzone to trigger adding a new file
            defaultPhoto: opts.defaultPhoto,
			multipart_params: {
				'_token': opts._token // Required for CSRF token validation in backend
			},
			multi_selection: false,
			filters: {
				mime_types: [
					{ title: 'image', extensions: 'jpg,jpeg,gif,png' }
				],
				prevent_duplicates: true
			},
			runtimes: 'html5'
		});

		var initDeleteButton = function(photo) {
			photo.find('div.delete-photo').on('click', function(e) {
				e.stopPropagation();
				var $target = $(e.target),
					$wrapper = $target.parents('div.single-photo'),
					rank = $wrapper.attr('id').match(/\d+/)[0];

				showSpinner();
				//$.post('/pet/' + opts.pet_id + '/delete_photo/' + rank, { _token: opts._token }, function(res) {
				//	console.log(res);
				//	if (res.status === 'success') {
				//		$wrapper.find('img').attr('src', '/img/v2/onboarding/default_main_photo.png');
				//		$wrapper.find('div.delete-photo').remove();
				//		$wrapper.removeClass('uploaded');
				//		$wrapper.find('div.add-photo').show();
				//		$.each(uploader.files, function(i, file) {
				//			uploader.removeFile(file);
				//		});
				//		updatePhotosAfterDelete(res.photos);
				//	}
				//}).always(function() {
				//	hideSpinner();
				//});

                $.ajax({
                    url: '/pet/' + opts.pet_id + '/delete_photo/' + rank,
                    method: 'DELETE',
                    headers: {
                        'X-CSRF-TOKEN': opts._token
                    },
                    success: function(res) {
                        console.log(res);
                        if (res.status === 'success') {
                            $wrapper.find('img').attr('src', '/img/v2/onboarding/default_main_photo.png');
                            $wrapper.find('div.delete-photo').remove();
                            $wrapper.removeClass('uploaded');
                            $wrapper.find('div.add-photo').show();
                            $.each(uploader.files, function(i, file) {
                                uploader.removeFile(file);
                            });
                            updatePhotosAfterDelete(res.photos);
                        }
                    },
                    always: function() {
                        hideSpinner();
                    }
                });
			});
		}

		var hideSpinnerTimeout;

		var showSpinner = function() {
			$('div.loading-overlay').show();
			hideSpinnerTimeout = setTimeout(hideSpinner, 5000);
		}

		var hideSpinner = function() {
			$('div.loading-overlay').hide();
			clearTimeout(hideSpinnerTimeout);
		}

		var updatePhotosAfterDelete = function(photos) {
			var photoIds = ['photo_1', 'photo_2', 'photo_3', 'photo_4'];
			$.each(photoIds, function(key, val) {
				var $wrapper = $('div#'+photoIds[key]);
				var found = false;
				var newUrl = opts.defaultPhoto;
				$.each(photos, function (k,v) {
					if (photos[k].id === photoIds[key] + '_id') {
						found = true;
						newUrl = photos[k].url;
					}
				});

				if (found) {
					$wrapper.find('img').attr('src', newUrl);
					$wrapper.addClass('uploaded');
					var thisUploader = uploaderObjects[photoIds[key]];
					thisUploader.disableBrowse(true);
					insertDeleteButton($wrapper);
				} else {
					$wrapper.find('img').attr('src', newUrl);
					$wrapper.removeClass('uploaded');
					var thisUploader = uploaderObjects[photoIds[key]];
					var lastKey = key - 1;
					if (photoIds[key] === 'photo_1') {
						thisUploader.disableBrowse(false);
					} else if ($('div#'+ photoIds[lastKey]).hasClass('uploaded')) {
						thisUploader.disableBrowse(false);
					} else {
						thisUploader.disableBrowse(true);
					}
					$wrapper.find('div.delete-photo').remove();
					$wrapper.find('div.add-photo').show();
				}
			});
		}

		var insertDeleteButton = function(photo) {
			var photoElem;
			if (typeof photo === 'undefined') {
				photoElem = elem;
			} else {
				photoElem = photo;
			}
			var $wrapper = photoElem.find('div.overlay');
			$wrapper.find('div.add-photo').hide();
			$wrapper.append('<div class="delete-photo photo-button"></div>');
			initDeleteButton(photoElem);
		}


		uploader.init();

		var maybeStartUpload = function() {
			var id = elem.attr('id'),
				rank = elem.attr('id').match(/\d+/)[0];
			
			// Always upload image 1, since it's first in the series
			if (rank === '1') {
				uploader.start();
				return true;
			} else if ( rank > 1 ) {
				// Only upload if previous rank has been uploaded
				uploader.start();
			} else {
				console.log('Unexpected failure');
			}
		}

        uploader.bind('Init', function(up) {
            elem.parents('div').find('div.moxie-shim').find('input').attr('accept', 'image/*');
            uploaderObjects[opts.photo_id] = up;
            if (opts.photo_id === 'photo_1' || elem.hasClass('uploaded')) {
            	up.disableBrowse(false);
                if (elem.hasClass('uploaded')) {
                    initDeleteButton(elem);
                }
            } else {
				var rank = elem.attr('id').match(/\d+/)[0];
				var previousRank = rank - 1;
				if ($('div#photo_'+previousRank).hasClass('uploaded')) {
                    up.disableBrowse(false);
                } else {
            	    up.disableBrowse(true);
                }
            }
        });

		uploader.bind('FilesAdded', function(up, files) {
			// Only upload file if previous rank of photo ID has been upload
			// Ex: prevent upload of photo_2 if photo_1 not uploaded
			maybeStartUpload();
		});

		uploader.bind('FileUploaded', function(up, file, result) {
			// Create array from response JSON, and populate elem's img
			// src attribute with the S3 url returned by backend
			var response = JSON.parse(result.response);
			elem.find('img').attr('src', response.photo.url);
			elem.addClass('uploaded'); // Used to detect if next rank of img should be uploaded in maybeStartUpload()

			elem.find('div.photo-label').toggleClass('upload-pending');
			elem.find('div.photo-label').find('span.desktop-only').text(defaultDesktopText);
			elem.find('div.photo-label').find('span.mobile-only').text(defaultMobileText);
			insertDeleteButton();

			var $photosSection = $('div.single-section[data-open-section="photos"]');
			if (typeof $photosSection !== 'undefined' && typeof response.sectionStatus !== 'undefined') {
				if (typeof response.sectionStatus !== 'undefined' && response.sectionStatus === 'complete') {
					$photosSection.trigger('photos:complete');
				} else {
					$photosSection.trigger('photos:incomplete');
				}
			}
		});

		uploader.bind('BeforeUpload', function(up, file) {
			// Change element so that it informs the user that upload is in progress
			console.log('before upload...');
			elem.find('div.photo-label').toggleClass('upload-pending');
			elem.find('div.photo-label').find('span.desktop-only').text(pendingDesktopText);
			elem.find('div.photo-label').find('span.mobile-only').text(pendingMobileText);
            var nextId = parseInt(opts.photo_id.match(/\d+/)[0]) + 1;
            if (nextId > 4) {
            	nextId = 4;
            }
            uploaderObjects['photo_'+nextId].disableBrowse(false);
            up.disableBrowse(true);
		});

		uploader.bind('UploadProgress', function(up, file) {
		});

		uploader.bind('Error', function(up, error) {
			console.log(error);
		});

        return uploader;
	};

	// Add any default options we want to set here
	$.fn.aapPhotoUpload.defaults = {
	};
}(jQuery));

