(function ($) {
	// Check if this is step-1 of onboarding
	var shouldRun = $('form#step-1-email').length > 0;
	if (shouldRun) {
		var $form = $('form#step-1-email');
		var $button = $form.find('input.blue');
		// General field UI
        var fieldActive = function() {
	    	var $field = $(this);
	    	$field.parent('div.field').parent('div.field-wrapper').addClass('active');
            if ($field.is('SELECT')) {
                changeSelectStyle($field);
            }
	    }

	    var showLabel = function($field) {
            if ($field.val() !== '') {
                $field.parent('div.field').find('label').addClass('show');
                $field.addClass('show');
            } else {
                hideLabel($field);
            }

	    }

        var triggerShowLabel = function(e) {
            var $field = $(e.target);
            showLabel($field);
        }

        var triggerHideLabel = function(e) {
            var $field = $(e.target);
            hideLabel($field);
        }

	    var hideLabel = function($field) {
	    	if ($field.val() == '' || typeof $field.val() === 'undefined') {
	    		$field.parent('div.field').find('label').removeClass('show');
                $field.removeClass('show');
	    	}
	    	$field.parent('div.field').parent('div.field-wrapper').removeClass('active');
	    	validateSingleField($field);
	    }
        var showError = function($field, message) {
	    	var $wrapper = $field.parent('div.field').parent('div.field-wrapper');
	    	var $errorMessageWrapper = $wrapper.find('span.error');
	    	if (typeof message !== 'undefined' && $errorMessageWrapper.length > 0) {
	    		$wrapper.find('span.error').html(message);
	    	}
	    	$wrapper.addClass('error');
	    }

	    var hideError = function($field) {
	    	var $wrapper = $field.parent('div.field').parent('div.field-wrapper');
	    	$wrapper.removeClass('error');
	    	$wrapper.find('span.error').html('');
	    }

	    var focusField = function() {
	    	$(this).find('input,select').focus();
	    }

		var validateEmail = function(email) {
		    var re = /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
		    return re.test(email);
		}

	    var validateSingleField = function($field) {
	    	var fieldValue = $field.val();

	    	if (fieldValue != '' && validateEmail(fieldValue)) {
	    		$button.attr('disabled', false);
	    	} else {
	    		$button.attr('disabled', true);
	    	}
	    }

	    var signUpButtonClicked = function() {
	    	if ($button.is(':disabled')) {
	    		return false;
	    	}

	    	if (window.sessionStorage) {
	    		window.sessionStorage.setItem('emailStep1', $form.find('input[name="email"]').val());
	    	}

	    	var petId = $form.find('input[name="pet_id"]').val();
	    	var data = {};
	    	data['email'] = $form.find('input[name="email"]').val();
	    	$.post('/list-a-pet/step-1/save-email/' + petId, data, function(response) {
	    		console.log(response);
	    	});

	    	swapFormDisplay();
	    }

	    var swapFormDisplay = function() {
	    	$('section.initial-show').hide();
	    	$('section.initial-hide').show();
	    }

	    var continueAsGuest = function(e) {
	    	e.preventDefault();
	    	swapFormDisplay();
	    }

	$(document).ready(function() {
		$form.find('input[type="email"]').on('keyup blur', triggerShowLabel);
		$form.find('input[type="email"]').on('keyup blur', triggerHideLabel);
		$form.find('input[type="button"]').on('click', signUpButtonClicked);
		$form.find('a.continue-as-guest').on('click', continueAsGuest);
	});
	}
}(jQuery));

