(function ($) {
	$.fn.republishPetModal = function() {
		var $elem = $(this),
			modalName = $elem.attr('data-modal-name'),
			submitUrl = $elem.find('div.aap-modal-fields').attr('data-modal-submit-url'),
			$closeButton = $elem.find('div.aap-modal-close').find('a.close-modal'),
			$cancelButton = $elem.find('div.aap-modal-buttons').find('button[data-modal-action="cancel"]'),
			$submitButton = $elem.find('div.aap-modal-buttons').find('button[data-modal-action="submit"]'),
			afterSubmit = $elem.find('div.aap-modal-fields').attr('data-modal-after-submit'),
			openModalEvent = $elem.attr('data-modal-open-event'),
			petId = $('input[name="pet_id"]').val();

		var $remodalInstance;

		var openModal = function() {
			$elem.removeClass('closed');
			$('html,body').css('overflow', 'hidden');
            $('.can-float').css('z-index', '9');
            maybeEnableSubmit();
		}

		var closeModal = function() {
			$(document).trigger('pet-status:reset');
			$elem.addClass('closed');
			$('html,body').css('overflow', 'auto');
            $('.can-float').css('z-index', '9999');
		}

		var cancelModal = function() {
			$elem.find('input,select').not(':button, :submit, :reset, :hidden, :checkbox, :radio').val('');
			closeModal();
		}


        var scrollToField = function($field) {
			var center = $(window).height()/2;
			var fieldTop = $field.offset().top - 50;
			if (fieldTop > center){
			    $elem.find('div.aap-modal-body').scrollTop(fieldTop-center);
			}
        }

        var initModal = function() {
            if (typeof window.location.hash !== 'undefined' && window.location.hash.indexOf('open-republish-pet-modal') > 0) {
		    	$(document).trigger('republish-pet-modal:open');
            }
        }

        var submitModal = function() {
        	if ($submitButton.hasClass('disabled')) {
        		return false;
        	}

        	var data = $elem.find('input,select,textarea').serialize();
			$.post('/mypets/save-deadline-reason/' + petId, data, function(response) {

				if (name === 'rehome_deadline') {
					ga('gtm1.send', 'event', 'Rehome Republish', 'Repubished Pet', true);
				}

				if (typeof response !== 'undefined' && typeof response.status !== 'undefined' && response.status === 'success') {
					updateRehomeByDate(response.data.rehomeByDate);
				}
			}).always(function() {
				$(document).trigger('banner:success');
			});

			closeModal();
        }

		var updateRehomeByDate = function(rehomeByDate) {
			$elem.find('span.rehome_by_date').text(rehomeByDate);
		}

        var selectChanged = function() {
        	var $field = $(this);
        	if ($field.val() === '') {
				$field.parent('div.field').find('label').removeClass('show');
				$field.removeClass('show');
        	} else {
				$field.parent('div.field').find('label').addClass('show');
				$field.addClass('show');

				if ($field.attr('name') === 'rehome_new_deadline') {
					ga('gtm1.send', 'event', 'Rehome Republish', 'Changed time to keep pet', true);
				}

				// Only update date if value set
				updateRehomeByDate();
        	}

        	maybeEnableSubmit();
        }

        var updateRehomeByDate = function() {
        	var weeks = $elem.find('select[name="rehome_new_deadline"]').val();
        	if (typeof weeks !== 'undefined' && weeks !== '') {
				var registerDate = new Date();
				var newDate = addWeeks(registerDate, weeks);
				var newDateString = (newDate.getMonth() + 1).toString() + '/' + newDate.getDate().toString() + '/' + newDate.getFullYear().toString();

        		$('div.rehome_deadline_wrapper').find('span.rehome_by_date').html(newDateString);
        	}
        }

        // Modified from https://stackoverflow.com/questions/563406/add-days-to-javascript-date
		var addWeeks = function(date, weeks) {
			var days = weeks * 7;
			var result = new Date(date);
			result.setDate(result.getDate() + days);
			return result;
		}

        var maybeEnableSubmit = function() {
        	var enableSubmit = true;
        	$elem.find('input.required,select.required,textarea.required').each(function() {
        		if ($(this).val() === '') {
        			enableSubmit = false;
        		}
        	});

        	if (enableSubmit) {
        		$submitButton.removeClass('disabled');
        	} else {
        		$submitButton.addClass('disabled');
        	}
        }


		$(document).ready(function() {
			if (typeof openModalEvent !== 'undefined') {
				$(document).on(openModalEvent, openModal);
			}
			$cancelButton.on('click', cancelModal);
			$closeButton.on('click', closeModal);
			$submitButton.on('click', submitModal);
			$(document).on(modalName + ':open', openModal);
			$(document).on(modalName + ':close', closeModal);
			$elem.find('select').on('change', selectChanged);

			$(document).keydown(function(e) {
				if (e.key === 'Escape' || e.key === 'Esc' || e.key === 27) {
					cancelModal();
				}
			});
            
            initModal();
		});
	}

	$(document).ready(function() {
		$('div[data-modal-name="republish-pet-modal"]').each(function() {
			$(this).republishPetModal();
		});
	});
}(jQuery));

