(function ($) {
	$.fn.shelterSearchAutocomplete = function() {
		var $elem = $(this),
			place = $elem.attr('data-search-location'),
			$hiddenInput = $('#'+ $elem.attr('data-hidden-input-id'));

		var init = function() {
			$.get('https://ra-api.adoptapet.com/v1/shelters?geoRange=50&location='+place, function(response) {
				var options = {
					data: response.body,
					getValue: "name",
					list: {
						sort: {
							enabled: true
						},
						match: {
							enabled: true
						},
						onSelectItemEvent: function() {
							var shelter = $elem.getSelectedItemData();
							$hiddenInput.val(shelter.shelterId);
						}
					}
				}

				$elem.easyAutocomplete(options);
			}).fail(function() {
				console.log('failed');
			});
		}

		$(document).ready(function() {
			init();
		});
	}

	if ($('input.easyautocomplete').length > 0) {
		$('input.easyautocomplete').shelterSearchAutocomplete();
	}
	//console.log('load');
}(jQuery));
