(function ($) {
    $.fn.rehomeSurvey = function() {
        var $survey = $(this),
            $submit = $survey.find('input[type="submit"]'),
            $required = $survey.find('[data-required="true"]'),
            $requiredIfShown = $survey.find('[data-required="true-if-shown"]');

        var maybeShowField = function($field) {
            var fieldValue = $field.val(),
                showLogic = $field.data('show-logic');


            if (typeof showLogic === 'undefined') {
                return false;
            }

            if (showLogic === 'boolean') {
                if (fieldValue == '1') {
                    $('#' + $field.data('show-if-true')).parents('div.form-field').removeClass('hidden');
                    $('#' + $field.data('show-if-false')).parents('div.form-field').addClass('hidden');
                }

                if (fieldValue == '0') {
                    $('#' + $field.data('show-if-true')).parents('div.form-field').addClass('hidden');
                    $('#' + $field.data('show-if-false')).parents('div.form-field').removeClass('hidden');
                }
            }

            return true;
        }


        var validateRequired = function() {
            var shouldEnable = true;

            $required.each(function() {
                if ($(this).val() === '') {
                    shouldEnable = false;
                }
            });

            $requiredIfShown.each(function() {
                if ($(this).is(':visible') && $(this).val() === '') {
                    shouldEnable = false;
                }
            });

            return shouldEnable;
        }

        var maybeToggleForm = function() {
            maybeShowField($(this));
            if ( validateRequired() ) {
                $submit.attr('disabled', false);
            } else {
                $submit.attr('disabled', true);
            }
        }

        $required.on('keyup change', maybeToggleForm);
        $requiredIfShown.on('keyup change', maybeToggleForm);
    }

    var $form = $('form#rehome-survey');

    if (typeof $form !== 'undefined') {
        $form.rehomeSurvey();
    }
}(jQuery));

