/*global
    Stripe, appConfig
*/
(function ($) {
  'use strict';
  if (typeof Stripe === 'undefined' || typeof window?.appConfig?.stripe?.publishableKey === 'undefined') {
    return;
  }
  // Create a Stripe client.
  var stripe = Stripe(appConfig.stripe.publishableKey);

  // Create an instance of Elements.
  var elements = stripe.elements();

  var closeIcon = $(".close_icon");

  var allInputs = $(".coach-modal :input");

  var submitButton = $(".submit-btn");

  var style = {
    base: {
      iconColor: '#8898AA',
      color: 'grey',
      lineHeight: '36px',
      fontWeight: 300,
      fontFamily: '"Helvetica Neue", Helvetica, sans-serif',
      fontSize: '19px',

      '::placeholder': {
        color: '#8898AA'
      },
    },
    invalid: {
      iconColor: '#e85746',
      color: '#e85746',
    }
  }

  // Create an instance of the card Element.
  var card = elements.create('card', {
    style: style
  });

  if ($('#card-element').length) {
    // Add an instance of the card Element into the `card-element` <div>.
    card.mount('#card-element');
  }

  // Handle real-time validation errors from the card Element.
  card.addEventListener('change', function (event) {
    var displayError = document.getElementById('card-errors');

    if (event.error) {
      displayError.textContent = event.error.message;
    } else {
      displayError.textContent = '';
    }

    if (event.complete === true) {
      maybeEnableSubmit();
    } else {
      disableButton();
    }

  });

  var maybeEnableSubmit = function () {
    if (validateInputs() === true) {
      enableButton();
      return true;
    } else {
      disableButton();
      return false;
    }
  }

  var validateInputs = function () {
    var stripeInputs = $("#card-element");
    var valid = true;

    allInputs.each(function () {
      var inputField = $(this);
      if (inputField[0].name !== "stripeToken" && inputField[0].name !== "") {
        if (inputField) {
          if (inputField.val() == "" || inputField.val().length < 1) {
            valid = false;
          }
        }
      }
    });

    return valid;
  }

  var clearStripeFields = function () {
    card.clear();
  }

  // Handle form submission.
  var form = document.getElementById('payment-form');

  if (form) {
    $(document).ready(function () {
      window.stripeFormCanEnable = true;
    });

    form.addEventListener('submit', function (event) {
      event.preventDefault();
      disableButton();

      stripe.createToken(card).then(function (result) {
        var petId = $("[data-pet-id]")[0];
        if (result.error) {
          // Inform the user if there was an error.
          var errorElement = document.getElementById('card-errors');
          $(document).trigger('contract-ga', ['adopter-encountered-an-error-while-paying', petId]);
          errorElement.textContent = result.error.message;
        } else {
          // Send the token to your server.
          $(document).trigger('contract-ga', ['adopter-submitted-payment-successfully', petId]);
          stripeTokenHandler(result.token);
        }
      });
    });
  }

  var buildCoachSignUpInfo = function () {
    var data = {};
    data.first_name = document.getElementById("first-name-input").value;
    data.last_name = document.getElementById("last-name-input").value;
    data.email = document.getElementById("coach-email-input").value;
    data.phone_number = document.getElementById("phone-number-input").value;

    var petId = $("[data-pet-id]")[0];

    data.pet_id = petId.attributes[1].value;

    return data;
  }

  var onPostsuccess = function (result, status, xhr) {
    $(".coach-payment-view").addClass("hide-element");
    $(".coach-confirmation-view").removeClass("hide-element");
    $(".bread-crumb-container").addClass("hide-element");

    if ($(".rehome-coach-wrapper-link")[0]) {
      $(".rehome-coach-wrapper-link")[0].style.display = "none";
    }
    if ($(".ribbon-cta-wrapper")[0]) {
      $(".ribbon-cta-wrapper")[0].style.display = "none";
    }

  }

  var onError = function (xhr, status, error) {
    var errorElement = document.getElementById('card-errors');
    window.stripeFormCanEnable = true;
    errorElement.textContent = error.message;
  }

  var enableButton = function () {
    if (typeof window.stripeFormCanEnable !== 'undefined' && window.stripeFormCanEnable) {
        return false;
    }
    submitButton[0].classList.remove("btn-disabled");
    submitButton[0].classList.add("btn-primary");
    submitButton.prop('disabled', false);
  }

  var disableButton = function () {
    submitButton[0].classList.add("btn-disabled");
    submitButton[0].classList.remove("btn-primary");
    submitButton.prop('disabled', true);
    window.stripeFormCanEnable = false;
  }

  // Submit the form with the token ID.
  function stripeTokenHandler(token) {
    var data = buildCoachSignUpInfo();
    data.token = token.id;

    $.ajax({
      type: "POST",
      url: '/v1/stripe/charge',
      data: data,
      success: onPostsuccess,
      error: onError,
      dataType: 'json'
    });

  }

  allInputs.blur(function () {
    maybeEnableSubmit();
  });

  closeIcon.on("click", clearStripeFields);
}(jQuery));

